import React from 'react';
import { Image } from 'react-native';

function LastImage() {
	return (
		<Image
			source={require('../../assets/three.png')}
			style={{ width: 320, height: 270, alignSelf: 'center', marginBottom: 30, marginTop: 30 }}
		/>
	);
}

export default LastImage;
